export default ({ children }) => {
  return children ? (
    <ul>
      {children}
      <style jsx>{`
        ul {
          display: flex;
          margin: 0;
          padding: 0;
          list-style: none;
        }

        ul > li {
          display: flex;
          justify-content: center;
          align-items: center;
          box-sizing: border-box;
          min-height: 80px;
          padding: 0 15px;
          font-size: 14px;
          font-family: ProximaNova, -apple-system, BlinkMacSystemFont,
            'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
          text-decoration: none;
        }
      `}</style>
    </ul>
  ) : null;
};
